// file: frontend/src/PredictForm.jsx
import React, { useState } from "react";

function PredictForm() {
  const [coin, setCoin] = useState("ADA");
  const [horizon, setHorizon] = useState("1");
  const [apiKey, setApiKey] = useState("");
  const [result, setResult] = useState(null);
  const [errorMsg, setErrorMsg] = useState("");

  async function handleSubmit(e) {
    e.preventDefault();
    setResult(null);
    setErrorMsg("");

    try {
      const resp = await fetch("http://localhost:5000/api/predict", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({
          coin: coin,
          horizon: horizon,
          cmc_api_key: apiKey   // NOTE: if you have your server loading env var, 
                                // you can skip sending cmc_api_key from the frontend.
        })
      });

      const data = await resp.json();
      if (!resp.ok) {
        // error from the server
        setErrorMsg(data.error || data.error_msg || "Request failed");
        console.log("STDOUT:", data.stdout);
        console.log("STDERR:", data.stderr);
      } else {
        if (data.status === "ok") {
          setResult(`Predicted Price = $${data.predicted_price}`);
        } else {
          setErrorMsg("Error: " + JSON.stringify(data));
        }
      }
    } catch (err) {
      setErrorMsg(err.message || "Something went wrong");
    }
  }

  return (
    <div>
      <h2 style={{ textAlign: "center", marginBottom: "1.5rem" }}>
        Crypto Prediction
      </h2>
      <form onSubmit={handleSubmit} style={{ marginBottom: "1rem" }}>
        <div>
          <label>Coin:</label>
          <select value={coin} onChange={(e) => setCoin(e.target.value)}>
            <option value="ADA">ADA</option>
            <option value="AVAX">AVAX</option>
            <option value="BCH">BCH</option>
            <option value="BNB">BNB</option>
            <option value="BTC">BTC</option>
            <option value="DOGE">DOGE</option>
            <option value="DOT">DOT</option>
            <option value="ETH">ETH</option>
            <option value="LEO">LEO</option>
            <option value="LINK">LINK</option>
            <option value="LTC">LTC</option>
            <option value="MATIC">MATIC</option>
            <option value="NEAR">NEAR</option>
            <option value="SHIB">SHIB</option>
            <option value="SOL">SOL</option>
            <option value="TON">TON</option>
            <option value="TRX">TRX</option>
            <option value="UNI">UNI</option>
            <option value="XRP">XRP</option>
          </select>
        </div>
        <div>
          <label>Predicted Days:</label>
          <select value={horizon} onChange={(e) => setHorizon(e.target.value)}>
            <option value="1">1</option>
            <option value="7">7</option>
            <option value="30">30</option>
            <option value="90">90</option>
          </select>
        </div>
        <div>
          <label>CMC API Key:</label>
          <input
            type="text"
            placeholder="Enter your CMC API Key"
            value={apiKey}
            onChange={(e) => setApiKey(e.target.value)}
          />
        </div>
        <button type="submit">Predict</button>
      </form>

      {result && <p className="result-msg">{result}</p>}
      {errorMsg && <p className="error-msg">{errorMsg}</p>}
    </div>
  );
}

export default PredictForm;
